def common_in_nested_lists(nestedlist):
    """
    Finds common elements in given nested lists.

    Args:
        nestedlist: A list of lists.

    Returns:
        A list of common elements.
    """
    if not nestedlist:
        return []

    common = []
    for sublist in nestedlist:
        if sublist:  # Check if the sublist is not empty
            for item in sublist:
                if item in common:
                    common.append(item)
    return sorted(list(set(common)))
```

