def assign_freq(test_list):
    """Assigns frequency to each tuple in the given tuple list.

    Args:
        test_list: A list of tuples.

    Returns:
        A list of tuples, where each tuple has its frequency assigned.
    """
    freq_map = {}
    for tup in test_list:
        if tup in freq_map:
            freq_map[tup] += 1
        else:
            freq_map[tup] = 1
    result = []
    for tup in test_list:
        result.append((tup, freq_map[tup]))
    return result
