def magic_square_test(my_matrix):
    """
    Checks if a given matrix is a magic square.

    Args:
        my_matrix: A list of lists representing the matrix.

    Returns:
        True if the matrix is a magic square, False otherwise.
    """
    n = len(my_matrix)
