    if n != len(my_matrix[0]):
        return False  # Must be a square matrix

    magic_constant = sum(my_matrix[0])

    for i in range(n):
        if sum(my_matrix[i]) != magic_constant:
            return False

    for i in range(n):
        for j in range(n):
            if my_matrix[i][j] != magic_constant:
                return False

    return True
