def longest_subseq_with_diff_one(arr, n):
    """
    Finds the longest subsequence such that the difference between adjacents is one for the given array.

    Args:
        arr (list): The input array.
        n (int): The length of the array.

    Returns:
        list: The longest subsequence.
    """
    if n == 0:
        return []

    dp = {}  # Store the longest subsequence ending at each index

    for i in range(n):
        dp[i] = [arr[i]]

    for i in range(1, n):
        for j in range(i):
            if abs(arr[i] - arr[j]) == 1:
                if j in dp and len(dp[j]) + 1 > len(dp[i]):
                    dp[i] = dp[j] + [arr[i]]

    max_len = 0
    max_subsequence = []
    for key in dp:
        if len(dp[key]) > max_len:
            max_len = len(dp[key])
            max_subsequence = dp[key]

    return max_subsequence
```

