import numpy as np

def find_x_y(a, b, n):
  """
  Finds the values of x and y that satisfy the equation ax + by = n.

  Args:
    a: The coefficient of x.
    b: The coefficient of y.
    n: The constant term.

  Returns:
    A tuple (x, y) if a and b are not both zero, otherwise None.
  """
  if a == 0 and b == 0:
    return None  # Avoid division by zero
  if a == 0:
    if b == 0:
      return None
    else:
      return (1, 0)
  if b == 0:
    if a == 0:
      return None
