    """
    Verifies the validity of a string of parentheses.

    Args:
        str1: The string to check.

    Returns:
        True if the string is valid, False otherwise.
    """
    stack = []
    parentheses_map = {')': '(', ']': '[', '}': '{'}

    for char in str1:
        if char in parentheses_map.values():
            stack.append(char)
        elif char in parentheses_map.keys():
            if not stack or stack.pop() != parentheses_map[char]:
                return False
        else:
            continue

    return not stack
