def combinations_colors(l, n):
    """
    Chooses specified number of colours from three different colours and generates all the combinations with repetitions.

    Args:
        l: A list of three different colours.
        n: The number of colours to choose.

    Returns:
        A list of all possible combinations with repetitions.
    """
    if n == 0:
        return [[]]
    if l == None or len(l) != 3:
        return []

    result = []
    for i in range(len(l)):
        first = l[i]
        for j in range(len(l)):
            if i != j:
                second = l[j]
                for k in range(len(l)):
                    if k != i and k != j:
                        third = l[k]
                        result.append([first, second, third])
    return result
