def even_binomial_Coeff_Sum(n):
    """
    Calculates the sum of even index binomial coefficients.

    Args:
      n: The number of terms in the binomial coefficient sum.

    Returns:
      The sum of even-indexed binomial coefficients.
    """
    if n < 0:
        return 0
    if n == 0:
        return 1

    total_sum = 0
    for i in range(n):
        if i % 2 == 0:
            total_sum += (
                (
                    factorial(n) // (factorial(i) * factorial(n - i))
                )
            )
    return total_sum

