def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the count of such binary sequences.
    """
    dp = {}

    def solve(index, current_sum, first_n, last_n):
        if index == 2 * n:
            return 1 if current_sum == first_n else 0

        if (index, current_sum, first_n, last_n) in dp:
            return dp[(index, current_sum, first_n, last_n)]

        count = 0
        for i in range(32):
            if index + i < 2 * n:
                new_first_n = first_n + (1 << i)
                new_last_n = last_n + (1 << (n - 1 - i))
                count += solve(index + i, new_first_n, new_first_n, new_last_n)

        dp[(index, current_sum, first_n, last_n)] = count
        return count

    return solve(0, 0, 0, 0)
