def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the count of such sequences.
    """

    if n < 0:
        return 0

    def is_binary_seq(seq):
        """Checks if a sequence is a valid binary sequence."""
        for i in range(len(seq) - 1):
            if seq[i] != '0' and seq[i+1] != '1':
                return False
        return True

    def count_sequences(length, current_seq, ones, zeros):
        """Recursively counts sequences."""
        if length == 2 * n:
            if is_binary_seq(current_seq):
                return 1
            else:
                return 0

        count = 0
        if ones < n:
            count += count_sequences(length, current_seq + '1', ones + 1, zeros)
        if zeros < ones:
            count += count_sequences(length, current_seq + '0', ones, zeros + 1)

        return count

    return count_sequences(n, '', 0, 0)
