    Finds the maximum occurring divisor in an interval [x, y] (inclusive).

    Args:
        x: The left endpoint of the interval.
        y: The right endpoint of the interval.

    Returns:
        The maximum occurring divisor in the interval [x, y].
    """
    if x > y:
        x, y = y, x

    if x == y:
        return x

    divisors = {}
    for i in range(x, y + 1):
        if i not in divisors:
            divisors[i] = 0
        divisors[i] += 1

    max_divisor = 0
    for divisor in divisors:
        if divisors[divisor] > max_divisor:
            max_divisor = divisors[divisor]

    return max_divisor
