def Check_Solution(a,b,c) -> bool:
    """
    Check whether one root of the quadratic equation is twice of the other or not.

    For example:
    Check_Solution(1, 2, 1) == True
    Check_Solution(1, 2, 3) == False
    """
    if a == 0 and b == 0:
        return False
    if a == 0:
        return b * b != 0
    if b == 0:
        return a * a != 0
    return (a**2 - b**2) == (2 * a * b)
