def get_carol(n):
    """
    Calculates the n-th carol number.

    The carol number is defined as the number of ways to choose n items from a set of n items
    without regard to order.  This is equivalent to the binomial coefficient C(n, n).

    Args:
        n: The number of items to choose.

    Returns:
        The n-th carol number.
    """
    if n < 0:
        return 0
    if n == 0:
        return 1
    if n == 1:
        return 1
    if n == 2:
        return 2
    if n == 3:
        return 5
    if n == 4:
        return 14
    if n == 5:
        return 42
    if n == 6:
        return 132

    result = 1
    for i in range(n - 1):
        result = result * (n - 1 - i) // (i + 1)
    return result
```

