    """
    Checks if a binary tree is balanced.

    A binary tree is balanced if for every node, the height difference between its
    left and right subtrees is not more than 1.

    Args:
        root: The root node of the binary tree.

    Returns:
        True if the tree is balanced, False otherwise.
    """
    def height(node):
        if not node:
            return 0
        return 1 + max(height(node.left), height(node.right))

    def is_balanced_helper(node):
        if not node:
            return True

        left_height = height(node.left)
        right_height = height(node.right)

        if abs(left_height - right_height) > 1:
            return False

        return is_balanced_helper(node.left) and is_balanced_helper(node.right)

    return is_balanced_helper(root)
