    """
    digits = sorted(str(n))
    if digits[0] == '0':
        first_non_zero = -1
        for i in range(1, len(digits)):
            if digits[i] != '0':
                first_non_zero = i
                break
        if first_non_zero != -1:
            digits[0], digits[first_non_zero] = digits[first_non_zero], digits[0]
    return int("".join(digits))
