def find_peak(arr, n):
    """
    Finds the peak element in the given array.

    A peak element is an element that is greater than or equal to its neighbors.
    If the array has only one element, it is considered a peak.

    Args:
        arr: The input array.
        n: The size of the array.

    Returns:
        The peak element in the array.
    """
    if n == 1:
        return arr[0]
    for i in range(n):
        if i == 0:
            if arr[i] > arr[i + 1]:
                return arr[i]
        elif i == n - 1:
            if arr[i] > arr[i - 1]:
                return arr[i]
        else:
            if arr[i] > arr[i - 1] and arr[i] > arr[i + 1]:
                return arr[i]
    return -1  # Should not happen if the array has at least one element
```

